import React, { Component } from "react";
import { NavigationBar } from "./components/Nvb";
import { Foot } from "./components/Footer";
import { Home } from "./Home";
import { Selling } from "./Selling";
import { Repair } from "./Repair";
import { News } from "./News";
import { Shop } from "./Shop";
import { About } from "./About";
import { Contact } from "./Contact";
import { HashRouter as Router, Route, Switch } from "react-router-dom";
import { createBrowserHistory } from "history";
import "./App.css";
import {
  newsarticle1,
  newsarticle2,
  newsarticle3,
  newsarticle4,
  newsarticle5,
  newsarticle6,
  newsarticle7,
  newsarticle8,
  newsarticle9,
  newsarticle10,
  newsarticle11,
  newsarticle12,
  newsarticle13,
  newsarticle14,
  newsarticle15,
  newsarticle16,
  newsarticle17,
  newsarticle18,
  newsarticle19,
  newsarticle20,
  newsarticle21,
  newsarticle22,
  newsMain
} from "./components/news_articles/newsarticles"

class App extends Component {
  render() {
    const history = createBrowserHistory({ basename: '/projects/reactjs/mobilus/' });

    return (
      <React.Fragment>
        <NavigationBar />
        <Router>
          <Switch basename="/projects/reactjs/mobilus/">
            <Route exact path="/" component={Home}></Route>
            <Route exact path="/selling" component={Selling}></Route>
            <Route exact path="/repair" component={Repair}></Route>
            <Route exact path="/news" component={News}></Route>
            <Route path="/news/article1" component={newsarticle1}></Route>
            <Route exact path="/shop" component={Shop}></Route>
            <Route exact path="/about" component={About}></Route>
            <Route exact path="/contact" component={Contact}></Route>
          </Switch>
        </Router>
        <Foot />
      </React.Fragment>
    );
  }
}

export default App;
